import reactDom from "react-dom";
import React, {Component} from 'react';

class AddProperty extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      description: "",
      address: "",
      price: null,
      square: null,
      number_of_bedrooms: null,
      number_of_bathrooms: null,
      number_of_car_parking: null,
    };
  }
}

export default AddProperty;
